import './App.css';

function App() {
  return (
    <div className="container">
      <div class="input-group mb-3">
        <button class="btn btn-outline-primary" type="button">Search</button>
        <input type="text" class="form-control" placeholder="Insert User ID"/>
      </div>
    </div>
  );
}

export default App;
